import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Morpion from '/home/lako/document/site_portfolio/portfolio/src/images/morpion.png'

function MyProjectCard() {
  return (
    <div id='projets'>



    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={Morpion} />
      <Card.Body>
        <Card.Title>Morpion</Card.Title>
        <Card.Text>
        Ce projet consiste à créer une implémentation du jeu du Morpion en utilisant JavaScript.
        </Card.Text>
        <Button variant="primary" href='https://github.com/Laconi-tech/Morpion' target='_blank'>Voir sur Github</Button>
      </Card.Body>
    </Card>
    ////////////////////////////////////////
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={Morpion} />
      <Card.Body>
        <Card.Title>Morpion</Card.Title>
        <Card.Text>
        Ce projet consiste à créer une implémentation du jeu du Morpion en utilisant JavaScript.
        </Card.Text>
        <Button variant="primary" href='https://github.com/Laconi-tech/Morpion' target='_blank'>Voir sur Github</Button>
      </Card.Body>
    </Card>
    </div>

  );
}

export default MyProjectCard;
